import React from 'react'
import { CardIconWrapper, CardTitle, CardTitleWrapper } from './Card.elements'

const Card = (props) => {
  return (
    <>
    <CardIconWrapper style={{background:props.color}}>
        {props.icon}
    </CardIconWrapper>
    <CardTitleWrapper>
        <CardTitle>
            {props.heading}
        </CardTitle>
    </CardTitleWrapper>
    </>
  )
}

export default Card
